import axios from 'axios';
import react, { useEffect, useState } from 'react';

function RegisterPage(props){
  const [ submit, setSubmit]= useState(false);

  useEffect( ()=>{
    const handleSubmit= async (e)=>{
      if (submit === true){
        await axios.post("/register", {
        username : 'john_doe',
        password : 'john_doe'
        })
        .then(
          await axios.get('/authenticate').then( res=>{if (res.data === 'authenticated'){
              props.changePage('ChatPage');
            }
          }
          )
        )
      }
      e.preventDefault();
      }
      handleSubmit();
    }, [setSubmit]);

  return(<div className="access-container">
  <div className="access">
    <div className="access-label">
      <span>Sign Up</span>
    </div>
    <hr />
    <br />
    <div>
      <label>Username</label>
      <input name="username" placeholder="john_doe"/>
    </div>
    <div>
      <label>Password</label>
      <input name="password" placeholder="password"/>
    </div>
    <button onClick={ ()=>(setSubmit(true)) }><i class="fa fa-sign-in" aria-hidden="true"></i></button>
  </div>
  </div>);
}
export default RegisterPage;
